import React, { Component } from 'react'
import StepItem from './StepItem';

export default class SecondSlide extends Component {
  renderSteps() {
    let arr = []
    for (let i = 1; i < 6; i++) {
      arr.push(<StepItem key={i} number={i} />);
    }
    return arr;
  }
  render() {
    return (
      <div className="second-slide">
        <div className="container">
          {this.renderSteps}
        </div>
      </div>
    )
  }
}
